import React from 'react';
import {Typography, AppBar, CardActions, Button, Card, CssBaseline, Toolbar} from '@mui/material';
import { FormatListNumbered } from '@mui/icons-material';

export default function Dashboard() {
    return (
        <>
            <CssBaseline />
            <AppBar position="relative">
                <Toolbar>
                    <FormatListNumbered />
                </Toolbar>
            </AppBar>
        </>
    )
}
